  display(data)
function display(data){
  document.querySelector("#jobs").innerHTML=null;
  data.forEach((ele)=>{
    let maindiv =document.createElement("div");
    maindiv.setAttribute("class","content")
    let div1 =document.createElement("div");
    let div2 =document.createElement("div");
    div2.setAttribute("id","info")
    let img=document.createElement("img");
    img.src=ele.image;
    let h4=document.createElement("h4");
    h4.innerText=ele.title;
    let p1=document.createElement("p")
    p1.innerText=ele.creator;
   let  div3=document.createElement("div")
   let img2=document.createElement("img")
   img2.src=ele.clockimage;
   img2.setAttribute("id","clock")
   let p2=document.createElement("p")
   p2.innerText=`Hours:${ele.hours}`;
   let img3=document.createElement("img")
   img3.src=ele.moduleimage;
   let p3=document.createElement("p")
   p3.innerText=ele.modules;
    div1.append(img)
    div3.append(img3,p3,img2,p2)
    div2.append(h4,p1,div3)
    maindiv.append(div1,div2)
    document.querySelector("#jobs").append(maindiv)
})

}

